<script>
export default {
    props: {
        jeffClick: {
            type: Function,
            default: () => {}
        },
    },
    data() {
        return {
            list: [
                'pelle', 'occhi', 'orecchie', 'bocca',
                'respiratorio', 'circolatorio', 'digerente', 'pelvica',
            ],
            label: [
                'Pelle', 'Occhi', 'Orecchio', 'Bocca',
                'Apparato Respiratorio', 'Apparato Circolatorio', 'Apparato Digerente', 'Zona Pelvica'
            ],
            selected: "",
            selectedCode: '',
            currentIndex: -1,
        }
    },
    methods: {
        listener(e) {
            if (e.keyCode == 39) {
                this.currentIndex++
                if (this.currentIndex > this.list.length - 1) {
                    this.currentIndex = 0
                }

                this.selected = this.label[this.currentIndex]
                this.selectedCode = this.list[this.currentIndex]

                if (this.$route.name === "Chapter") {
                    this.jeffClick(this.selectedCode)
                }
            }
            if (e.keyCode == 37) {
                this.currentIndex--
                if (this.currentIndex < 0) {
                    this.currentIndex = this.list.length - 1
                }
                this.selected = this.list[this.currentIndex]
                this.selectedCode = this.list[this.currentIndex].toLowerCase()
            }
            if (e.keyCode == 13 && this.selectedCode !== "") {
                this.jeffClick(this.selectedCode)
            }
        }
    },
    mounted() {
        //on hover of #cuore
        this.$refs.cuore.addEventListener('mouseover', () => {
            this.selectedCode = 'circolatorio'
            this.selected = "Apparato Circolatorio"
        });
        //on click on #cuore
        this.$refs.cuore.addEventListener('click', () => {
            this.jeffClick('circolatorio')
        });

        //on hover of #pelle
        this.$refs.pelle.addEventListener('mouseover', () => {
            this.selectedCode = 'pelle'
            this.selected = "Pelle"
        })
        //on click on #pelle
        this.$refs.pelle.addEventListener('click', () => {
            this.jeffClick('pelle')
        })

        //on hover of #polmoni
        this.$refs.polmoni.addEventListener('mouseover', () => {
            this.selectedCode = 'respiratorio'
            this.selected = "Apparato Respiratorio"
        })
        //on click on #polmoni
        this.$refs.polmoni.addEventListener('click', () => {
            this.jeffClick('respiratorio')
        })

        //on hover of #digestivo
        this.$refs.digestivo.addEventListener('mouseover', () => {
            this.selectedCode = 'digerente'
            this.selected = "Apparato Digerente"
        })
        //on click on #digestivo
        this.$refs.digestivo.addEventListener('click', () => {
            this.jeffClick('digerente')
        })

        //on hover of #urinario
        this.$refs.urinario.addEventListener('mouseover', () => {
            this.selectedCode = 'pelvica'
            this.selected = "Zona Pelvica"
        })
        //on click on #urinario
        this.$refs.urinario.addEventListener('click', () => {
            this.jeffClick('pelvica')
        })

        //on hover of #orecchio
        this.$refs.orecchio.addEventListener('mouseover', () => {
            this.selectedCode = 'orecchie'
            this.selected = "Orecchio"
        })
        //on click on #orecchio
        this.$refs.orecchio.addEventListener('click', () => {
            this.jeffClick('orecchie')
        })

        //on hover of #occhi
        this.$refs.occhi.addEventListener('mouseover', () => {
            this.selectedCode = 'occhi'
            this.selected = "Occhi"
        })
        //on click on #occhi
        this.$refs.occhi.addEventListener('click', () => {
            this.jeffClick('occhi')
        })

        //on hover of #bocca
        this.$refs.bocca.addEventListener('mouseover', () => {
            this.selectedCode = 'bocca'
            this.selected = "Bocca"
        })
        //on click on #bocca
        this.$refs.bocca.addEventListener('click', () => {
            this.jeffClick('bocca')
        })

        //on exit of #svg
        this.$refs.svg.addEventListener('mouseout', () => {
            this.selected = ""
            this.selectedCode = ''
        });

        //on key down
        document.addEventListener('keydown', this.listener)

    },
    beforeDestroy() {
        document.removeEventListener('keydown', this.listener)
    }
}
</script>

